import FooPages from './pages/FooPages'
import BarPages from './pages/BarPages'


const routes = [
  {
    path: '/foo',
    components: FooPages
  },
    {
    path: '/bar',
    components: BarPages
  },
]

const router = VueRouter.createRouter({ routes })

export default router
